      sources: ["fileUpload.ts"],
      sourcesContent: ["/*\n * Copyright (c) 2014-2022 Bjoern Kimminich & the OWASP Juice Shop contributors.\n * SPDX-License-Identifier: MIT\n */\n\nimport fs = require('fs')\nimport challengeUtils = require('../lib/challengeUtils')\nimport { NextFunction, Request, Response } from 'express'\n\nconst utils = require('../lib/utils')\nconst challenges = require('../data/datacache').challenges\nconst libxml = require('libxmljs2')\nconst os = require('os')\nconst vm = require('vm')\nconst unzipper = require('unzipper')\nconst path = require('path')\n\nfunction ensureFileIsPassed ({ file }: Request, res: Response, next: NextFunction) {\n  if (file) {\n    next()\n  }\n}\n\nfunction handleZipFileUpload ({ file }: Request, res: Response, next: NextFunction) {\n  if (utils.endsWith(file?.originalname.toLowerCase(), '.zip')) {\n    if (file?.buffer && !utils.disableOnContainerEnv()) {\n      const buffer = file.buffer\n      const filename = file.originalname.toLowerCase()\n      const tempFile = path.join(os.tmpdir(), filename)\n      fs.open(tempFile, 'w', function (err, fd) {\n        if (err != null) { next(err) }\n        fs.write(fd, buffer, 0, buffer.length, null, function (err) {\n          if (err != null) { next(err) }\n          fs.close(fd, function () {\n            fs.createReadStream(tempFile)\n              .pipe(unzipper.Parse())\n              .on('entry', function (entry: any) {\n                const fileName = entry.path\n                const absolutePath = path.resolve('uploads/complaints/' + fileName)\n                challengeUtils.solveIf(challenges.fileWriteChallenge, () => { return absolutePath === path.resolve('ftp/legal.md') })\n                if (absolutePath.includes(path.resolve('.'))) {\n                  entry.pipe(fs.createWriteStream('uploads/complaints/' + fileName).on('error', function (err) { next(err) }))\n                } else {\n                  entry.autodrain()\n                }\n              }).on('error', function (err: unknown) { next(err) })\n          })\n        })\n      })\n    }\n    res.status(204).end()\n  } else {\n    next()\n  }\n}\n\nfunction checkUploadSize ({ file }: Request, res: Response, next: NextFunction) {\n  if (file) {\n    challengeUtils.solveIf(challenges.uploadSizeChallenge, () => { return file?.size > 100000 })\n  }\n  next()\n}\n\nfunction checkFileType ({ file }: Request, res: Response, next: NextFunction) {\n  const fileType = file?.originalname.substr(file.originalname.lastIndexOf('.') + 1).toLowerCase()\n  challengeUtils.solveIf(challenges.uploadTypeChallenge, () => {\n    return !(fileType === 'pdf' || fileType === 'xml' || fileType === 'zip')\n  })\n  next()\n}\n\nfunction handleXmlUpload ({ file }: Request, res: Response, next: NextFunction) {\n  if (utils.endsWith(file?.originalname.toLowerCase(), '.xml')) {\n    challengeUtils.solveIf(challenges.deprecatedInterfaceChallenge, () => { return true })\n    if (file?.buffer && !utils.disableOnContainerEnv()) { // XXE attacks in Docker/Heroku containers regularly cause \"segfault\" crashes\n      const data = file.buffer.toString()\n      try {\n        const sandbox = { libxml, data }\n        vm.createContext(sandbox)\n        const xmlDoc = vm.runInContext('libxml.parseXml(data, { noblanks: true, noent: true, nocdata: true })', sandbox, { timeout: 2000 })\n        const xmlString = xmlDoc.toString(false)\n        challengeUtils.solveIf(challenges.xxeFileDisclosureChallenge, () => { return (utils.matchesSystemIniFile(xmlString) ?? utils.matchesEtcPasswdFile(xmlString)) })\n        res.status(410)\n        next(new Error('B2B customer complaints via file upload have been deprecated for security reasons: ' + utils.trunc(xmlString, 400) + ' (' + file.originalname + ')'))\n      } catch (err: any) { // TODO: Remove any\n        if (utils.contains(err.message, 'Script execution timed out')) {\n          if (challengeUtils.notSolved(challenges.xxeDosChallenge)) {\n            challengeUtils.solve(challenges.xxeDosChallenge)\n          }\n          res.status(503)\n          next(new Error('Sorry, we are temporarily not available! Please try again later.'))\n        } else {\n          res.status(410)\n          next(new Error('B2B customer complaints via file upload have been deprecated for security reasons: ' + err.message + ' (' + file.originalname + ')'))\n        }\n      }\n    } else {\n      res.status(410)\n      next(new Error('B2B customer complaints via file upload have been deprecated for security reasons (' + file?.originalname + ')'))\n    }\n  }\n  res.status(204).end()\n}\n\nmodule.exports = {\n  ensureFileIsPassed,\n  handleZipFileUpload,\n  checkUploadSize,\n  checkFileType,\n  handleXmlUpload\n}\n"],
